import { HttpException, HttpStatus, Injectable } from '@nestjs/common';

@Injectable()
export class AppService {
  getHello(): string {
    return 'Hello World!';
  }

  private sendErrorResponse(data, responseData) {
    return {
      Message: data.message || 'Error occured',
      Code: data.code || '00',
      ...responseData,
    };
  }

  private sendSuccessResponse(responseData) {
    return {
      Message: 'Success',
      Code: '00',
      ...responseData,
    };
  }

  /*
    The is a dummy method that mimicks saving a record on a DB. Ideally,
    this will connect to the MogoDB database for the application and save the 
    request and response as a document in the choosen collection
  */
  public saveRequest(request, response) {
    console.log('Saved to DB:', JSON.stringify(request, response));
  }

  async validateBvn(payload: { bvn?: string }): Promise<any> {
    let response;
    if (!payload.bvn) {
      response = this.sendErrorResponse(
        {
          code: '400',
          message:
            'One or more of your request parameters failed validation. Please retry',
        },
        {},
      );
      this.saveRequest(payload, response);
      throw new HttpException(response, HttpStatus.BAD_REQUEST);
    }
    if (payload.bvn.length !== 11) {
      response = this.sendErrorResponse(
        {
          code: '02',
          message: 'The searched BVN is invalid',
        },
        { bvn: payload.bvn },
      );
      this.saveRequest(payload, response);
      throw new HttpException(response, HttpStatus.BAD_REQUEST);
    }
    if (!/^\d+$/.test(payload.bvn)) {
      response = this.sendErrorResponse(
        {
          code: '400',
          message: 'The searched BVN is invalid',
        },
        { bvn: payload.bvn },
      );
      this.saveRequest(payload, response);
      throw new HttpException(response, HttpStatus.BAD_REQUEST);
    }
    if (payload.bvn !== '11223344556') {
      response = this.sendErrorResponse(
        {
          code: '01',
          message: 'The searched BVN does not exist',
        },
        { bvn: payload.bvn },
      );
      this.saveRequest(payload, response);
      throw new HttpException(response, HttpStatus.BAD_REQUEST);
    }
    response = this.sendSuccessResponse({
      Bvn: payload.bvn,
      ImageDetail: 'lsof',
      BasicDetail:
        'data:image/jpeg;base64,',
    });
    this.saveRequest(payload, response);
    return response;
  }
}
